def split_op(inputs, label, if_val=False):
    # split input data to little windows
    inputs_ = None
    label_ = None
    # inputs[inputs > up_line] = up_line
    # inputs[inputs < down_line] = down_line
    # inputs = inputs / up_line
    load_num = int((len(inputs) - LOAD_SIZE) / INTER_SIZE)
    # load_num = int((len(inputs) - LOAD_SIZE) / INTER_SIZE) * _load_num[int(label)])
    if load_num < 1:
        load_num = 1
    if if_val:
        VAL_TYPE[int(label)] += load_num
    else:
        TYPE[int(label)] += load_num
    for l_num in range(load_num):
        start = l_num * INTER_SIZE
        if l_num == 0:
            inputs_ = np.reshape(inputs[start:start + LOAD_SIZE], [-1])
            label_ = label
        else:
            inputs_ = np.vstack((inputs_, np.reshape(inputs[start:start + LOAD_SIZE], [-1])))
            label_ = np.vstack((label_, label))
    return np.reshape(inputs_, [-1, LOAD_SIZE]), np.reshape(label_, [-1, 1])


def pad(value, pad_value, pad_len=INTER_SIZE):
    value_ = np.lib.pad(value, (0, pad_len), 'constant', constant_values=(pad_value, pad_value))
    return value_


def normalization(signals):
    # print(np.shape(signal))
    mean = np.mean(signals)
    std = np.sqrt(np.sum((signals - mean) ** 2) / (len(signals) - 1))
    signals_ = (signals - mean) / std

    return np.reshape(signals_, [-1])


def tf_record(train_input, train_label, val_input, val_label, save_dir):
    if not os.path.exists(save_dir):
        os.makedirs(save_dir)

    # write training data
    train_length = [0 for _ in range(PAD_NUM)]
    for pad_type in range(PAD_NUM):
        with tf.python_io.TFRecordWriter(
                os.path.expanduser(os.path.join(save_dir, 'train_' + str(pad_type) + '.tfrecord'))) \
                as writer:
            for train_length[pad_type], input_t in enumerate(train_input[pad_type]):
                data_length = len(input_t)
                input_t_ = input_t.astype(np.float32)
                sequence_ti = input_t_.tostring()
                sequence_tl = int(train_label[pad_type][train_length[pad_type]])
                example_t = tf.train.Example(features=tf.train.Features(feature={
                    'length': tf.train.Feature(int64_list=tf.train.Int64List(value=[data_length])),
                    'input': tf.train.Feature(bytes_list=tf.train.BytesList(value=[sequence_ti])),
                    'label': tf.train.Feature(int64_list=tf.train.Int64List(value=[sequence_tl]))
                }))
                writer.write(example_t.SerializeToString())
            train_length[pad_type] += 1

    # write the validation set
    with tf.python_io.TFRecordWriter(os.path.expanduser(os.path.join(save_dir, 'val.tfrecord'))) \
            as writer:
        val_length = 0
        for val_length, input_v in enumerate(val_input):
            data_length = len(input_v)
            input_v_ = input_v.astype(np.float32)
            sequence_vi = input_v_.tostring()
            sequence_vl = int(val_label[val_length])
            example_v = tf.train.Example(features=tf.train.Features(feature={
                'length': tf.train.Feature(int64_list=tf.train.Int64List(value=[data_length])),
                'input': tf.train.Feature(bytes_list=tf.train.BytesList(value=[sequence_vi])),
                'label': tf.train.Feature(int64_list=tf.train.Int64List(value=[sequence_vl]))
            }))
            writer.write(example_v.SerializeToString())
        val_length += 1

    print(
        "Train data number: {} {} {} {} {} ".format(train_length[0], train_length[1], train_length[2], train_length[3],
                                                    train_length[4]))
    print("Validation data number: {}".format(val_length))

    with tf.python_io.TFRecordWriter(os.path.expanduser(os.path.join(save_dir, 'record.tfrecord'))) as writer_r:
        seq_PAD_LEN = np.array(PAD_LEN).astype(np.int64)
        seq_pad_len = seq_PAD_LEN.tostring()
        seq_train_length = np.array(train_length).astype(np.int64)
        seq_train_length_ = seq_train_length.tostring()
        example = tf.train.Example(features=tf.train.Features(feature={
            'pad_length': tf.train.Feature(bytes_list=tf.train.BytesList(value=[seq_pad_len])),
            'train_length': tf.train.Feature(bytes_list=tf.train.BytesList(value=[seq_train_length_])),
            'val_length': tf.train.Feature(int64_list=tf.train.Int64List(value=[val_length]))
        }))
        writer_r.write(example.SerializeToString())


def main():
    # reading the data-set and pre-processing the inputs and the labels.
    tf.logging.set_verbosity(tf.logging.INFO)

    print('Start reading data.')

    input_dir = FLAGS.input_dir
    save_dir = FLAGS.save_dir

    # read label
    label_path = os.path.join(input_dir, 'REFERENCE.csv')
    file = open(label_path)
    read = csv.reader(file)
    labels = []
    for label_ in read:
        labels.append(label_)

    train_inputs = [[] for _ in range(PAD_NUM)]
    train_labels = [[] for _ in range(PAD_NUM)]
    train_num = 0
    val_inputs = []
    val_labels = []
    val_num = 0
    val_len_record = [0]
    val_label_record = [0]
    # read data
    for file_in_dir in input_list:
        data_path = os.path.join(input_dir, file_in_dir)
        value = np.reshape(sio.loadmat(data_path)['val'], [-1])
        file_name = int(os.path.splitext(file_in_dir)[0][1:])
        label_val = labels[file_name - 1][1]
        label = rhythm_list.index(label_val)
        find_name = 'A' + '{:05}'.format(file_name)
        # split validation and training
        if find_name in validation_list:
            inputs = normalization(value)
            val_num += 1
            VAL_TYPE[int(label)] += 1
            val_inputs.append(inputs)
            val_labels.append(label)
        else:
            inputs = normalization(value)
            if len(value) <= 6000:
                pad_type = 0
            elif len(value) <= 9100:
                pad_type = 1
            elif len(value) <= 12000:
                pad_type = 2
            elif len(value) <= 16000:
                pad_type = 3
            else:
                pad_type = 4
            inputs_ = pad(inputs, pad_value=np.mean(inputs), pad_len=(PAD_LEN[pad_type] - len(inputs)))
            train_num += 1
            TYPE[int(label)] += 1
            train_inputs[pad_type].append(inputs_)
            train_labels[pad_type].append(label)

    print('Reading over, training file number: {:d}, validation file num: {:d}'.format(train_num, val_num))
    print("Training type: {:d}, {:d}, {:d}, {:d}".format(TYPE[0], TYPE[1], TYPE[2], TYPE[3]))
    print("Validation type: {:d}, {:d}, {:d}, {:d}".format(VAL_TYPE[0], VAL_TYPE[1], VAL_TYPE[2], VAL_TYPE[3]))

    tf_record(train_inputs, train_labels, val_inputs, val_labels, save_dir)
    print('Processing over.')


if __name__ == '__main__':
    tf.app.run(main)
